import React, { useState } from "react";
import "./Register.css";

const Register = () => {
  const [formChange, setFormChange] = useState({
    fname: "",
    mname: "",
    lname: "",
    email: "",
    number: "",
  });

  const change = (event) => {
    event.preventDefault();
    const val = event.target.value;
    const nam = event.target.name;

    if (nam == "fname") {
      setFormChange({
        ...formChange, fname: val
      });
    }

    if (nam == "mname") {
      setFormChange({
        ...formChange, mname: val
      });
    }

    if (nam == "lname") {
      setFormChange({
        ...formChange, lname: val
      });
    }

    if (nam == "email") {
      setFormChange({
        email: val,
      });
    }

    if (nam == "number") {
      setFormChange({
        number: val,
      });
    }
  };

  return (
    <>
      <div className="register-form">
        <form onSubmit={console.log(formChange)}>
          <input
            value={formChange.fname}
            type="text"
            placeholder="First Name"
            autoComplete="off"
            name="fname"
            onChange={change}
            required
          />

          <input
            value={formChange.mname}
            type="text"
            placeholder="Middle Name"
            autoComplete="off"
            name="mname"
            onChange={change}
          />

          <input
            value={formChange.lname}
            type="text"
            placeholder="Last Name"
            autoComplete="off"
            name="lname"
            onChange={change}
            required
          />

          <input
            value={formChange.email}
            type="email"
            placeholder="Email Address"
            autoComplete="off"
            name="email"
            onChange={change}
            required
          />

          <input
            value={formChange.fname}
            type="number"
            placeholder="Phone Number"
            autoComplete="off"
            name="number"
            onChange={change}
            required
          />

          <input
            className="photo-input"
            type="file"
            accept="image/png, image/gif, image/jpeg, image/jpg"
            placeholder="Photo"
            autoComplete="off"
            name="photo"
            onChange={change}
            // required
          />

          <button
            type="submit"
            onClick={(event) => {
              event.preventDefault();

              // setFinalChange({
              //   fname: formChange.fname,
              //   mname: formChange.mname,
              //   lname: formChange.lname,
              //   email: formChange.email,
              //   number: formChange.number,
              // });

              // console.log(finalChange);
            }}
          >
            Submit
          </button>
        </form>
      </div>
    </>
  );
};

export default Register;
